import React from 'react';
import Sketchfab from 'sketchfab';
import $ from 'jquery';

import {Link} from 'react-router-dom';

import '../../Style/Portfolio.css';

class Project12 extends React.Component {

    componentDidMount() {

        initializeSketchFab();

        function initializeSketchFab() {
            const version = '6.4.1'
            const iframe = document.getElementById('api-frame')
            const client = new window.Sketchfab(version, iframe)
            const modelId = "7w7pAfrCfjovwykkEeRFLGw5SXS";

            client.init(
                modelID,
                {
                    camera: 0,
                    preload: 0,
                    scrollwheel: 0,
                    navigation: 'fps',
                    annotations_visible: 0,
                    transparent: 1,
                    ui_stop: 0,
                    ui_infos: 0,
                    ui_controls: 0,
                    fps_speed: 0,
                    success: (api) => {
                        api.load()
                        api.start()
                        this.setSketchFab(api)
                        this.apiEventListeners()
                    },
                    error: function onError() {
                        console.log('Viewer error')
                    }
                }
            )
        }
    }

    render(){

        return(
            <div className= "portfolio-panel" id = "portfolio">
                <div className= "container">
                    <div className= "orange-stripe"></div>
                    <h1 className= "portfolio-heading">Portfolio</h1>
                    <h5 className= "my-work">My Work</h5>
                </div>

                <div className= "container">
                    <iframe src="" id="api-frame" allowFullScreen mozallowfullscreen="true" webkitallowfullscreen="true"
                            width="400px" height="300px"></iframe>
                </div>
            </div>
        )
    }
}

export default Project12;
